import requests
import json

files = {'input_image':['',]}
def request_number(files):
    r = requests.post("http://52.68.251.128/api_person_predict/", json=json.dumps(files)) # jsonPOST
    # r = requests.get("http://127.0.0.1:8000/api_person_predict/") # jsonPOST
    # print(r.json())
    import ast
    dic = ast.literal_eval(json.dumps(r.json()))
    print(ast.literal_eval(dic[1])["count"])
    return ast.literal_eval(dic[1])["count"]

if __name__ == "__main__":
    print(type(request_number(files)))